  }
  ]);

  return (
    <div className="App">

      <Jumbotron text='Zaheer Roberts' text2='Coder  Designer  Gamer'  />
      {State1.map((data, index) => (
            <TextBanner key={index}  heading={data.heading} paragraph1={data.paragraph1} />))}
